import React from 'react';
import './ProgressBar.css';

const ProgressBar = ({ steps, selectedSkip, skipOptions }) => {
  const selectedSkipData = selectedSkip ? skipOptions.find(skip => skip.id === selectedSkip) : null;

  const getStepIcon = (index) => {
    const icons = ['📍', '🗑️', '📦', '✅', '📅', '💳'];
    return icons[index] || '•';
  };

  return (
    <div className="progress-sidebar">
      <div className="booking-header">
        <h2>Skip Hire Booking</h2>
        <p>Complete your waste collection order</p>
      </div>
      
      <div className="progress-steps">
        <h3>Progress</h3>
        {steps.map((step, index) => (
          <div key={index} className={`step-item ${step.completed ? 'completed' : ''} ${step.active ? 'active' : ''}`}>
            <div className="step-indicator">
              <span className="step-icon">{getStepIcon(index)}</span>
              {index < steps.length - 1 && <div className={`step-connector ${step.completed ? 'completed' : ''}`}></div>}
            </div>
            <div className="step-content">
              <div className="step-label">{step.label}</div>
              {step.completed && <div className="step-status">✓ Complete</div>}
              {step.active && <div className="step-status active">In Progress</div>}
            </div>
          </div>
        ))}
      </div>

      {selectedSkipData && (
        <div className="booking-summary">
          <h3>Selected Skip</h3>
          <div className="summary-card">
            <div className="skip-summary-header">
              <h4>{selectedSkipData.name}</h4>
              <div className="skip-summary-price">{selectedSkipData.price}</div>
            </div>
            <div className="skip-summary-details">
              <div className="detail-item">
                <span className="detail-label">Duration:</span>
                <span className="detail-value">{selectedSkipData.hirePeriod}</span>
              </div>
              <div className="detail-item">
                <span className="detail-label">Location:</span>
                <span className="detail-value">{selectedSkipData.postcode}</span>
              </div>
              {selectedSkipData.allowedOnRoad && (
                <div className="feature-tag road">🛣️ Road Permitted</div>
              )}
              {selectedSkipData.allowsHeavyWaste && (
                <div className="feature-tag heavy">⚠️ Heavy Waste OK</div>
              )}
            </div>
            <button className="continue-booking-btn">
              Continue to Next Step →
            </button>
          </div>
        </div>
      )}

      <div className="help-section">
        <h4>Need Help?</h4>
        <p>Contact our team for assistance with your skip hire booking.</p>
        <button className="help-btn">📞 Call Support</button>
      </div>
    </div>
  );
};

export default ProgressBar;
